<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Employee Lookup - Pashann</title>
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=DM+Sans:wght@400;500;700&family=Playfair+Display:wght@600;700&display=swap" rel="stylesheet">
    <style>
        :root {
            --color-bg: #0a0e1a;
            --color-surface: #151b2e;
            --color-surface-hover: #1d2740;
            --color-border: #2a3550;
            --color-text-primary: #f8fafc;
            --color-text-secondary: #94a3b8;
            --color-text-muted: #64748b;
            --color-active: #10b981;
            --color-active-bg: rgba(16, 185, 129, 0.1);
            --color-terminated: #f59e0b;
            --color-terminated-bg: rgba(245, 158, 11, 0.1);
            --color-not-found: #ef4444;
            --color-not-found-bg: rgba(239, 68, 68, 0.1);
            --color-accent: #3b82f6;
            --color-accent-hover: #2563eb;
            --shadow-sm: 0 2px 8px rgba(0, 0, 0, 0.3);
            --shadow-md: 0 4px 16px rgba(0, 0, 0, 0.4);
            --shadow-lg: 0 8px 32px rgba(0, 0, 0, 0.5);
        }

        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'DM Sans', -apple-system, BlinkMacSystemFont, sans-serif;
            background: linear-gradient(135deg, #0a0e1a 0%, #1a1f35 100%);
            color: var(--color-text-primary);
            min-height: 100vh;
            padding: 20px;
            line-height: 1.6;
            -webkit-font-smoothing: antialiased;
        }

        .container {
            max-width: 1000px;
            margin: 0 auto;
            animation: fadeIn 0.6s ease-out;
        }

        @keyframes fadeIn {
            from {
                opacity: 0;
                transform: translateY(20px);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }

        header {
            text-align: center;
            margin-bottom: 48px;
            animation: slideDown 0.8s ease-out;
        }

        @keyframes slideDown {
            from {
                opacity: 0;
                transform: translateY(-30px);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }

        h1 {
            font-family: 'Playfair Display', serif;
            font-size: clamp(2rem, 5vw, 3rem);
            font-weight: 700;
            margin-bottom: 12px;
            background: linear-gradient(135deg, #f8fafc 0%, #cbd5e1 100%);
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
            background-clip: text;
            letter-spacing: -0.02em;
        }

        .subtitle {
            color: var(--color-text-secondary);
            font-size: 1.125rem;
            font-weight: 400;
        }

        .search-container {
            background: var(--color-surface);
            border: 1px solid var(--color-border);
            border-radius: 16px;
            padding: 32px;
            margin-bottom: 32px;
            box-shadow: var(--shadow-md);
            animation: scaleIn 0.5s ease-out 0.2s both;
        }

        @keyframes scaleIn {
            from {
                opacity: 0;
                transform: scale(0.95);
            }
            to {
                opacity: 1;
                transform: scale(1);
            }
        }

        .search-input-wrapper {
            position: relative;
            margin-bottom: 20px;
        }

        .search-input {
            width: 100%;
            padding: 18px 24px;
            font-size: 1.125rem;
            border: 2px solid var(--color-border);
            border-radius: 12px;
            background: var(--color-bg);
            color: var(--color-text-primary);
            font-family: 'DM Sans', sans-serif;
            transition: all 0.3s ease;
            outline: none;
        }

        .search-input:focus {
            border-color: var(--color-accent);
            box-shadow: 0 0 0 4px rgba(59, 130, 246, 0.1);
        }

        .search-input::placeholder {
            color: var(--color-text-muted);
        }

        .button-group {
            display: flex;
            gap: 12px;
            flex-wrap: wrap;
        }

        button {
            flex: 1;
            min-width: 140px;
            padding: 14px 28px;
            font-size: 1rem;
            font-weight: 600;
            border: none;
            border-radius: 10px;
            cursor: pointer;
            font-family: 'DM Sans', sans-serif;
            transition: all 0.3s ease;
            display: flex;
            align-items: center;
            justify-content: center;
            gap: 10px;
            box-shadow: var(--shadow-sm);
        }

        .btn-primary {
            background: var(--color-accent);
            color: white;
        }

        .btn-primary:hover:not(:disabled) {
            background: var(--color-accent-hover);
            transform: translateY(-2px);
            box-shadow: var(--shadow-md);
        }

        .btn-secondary {
            background: var(--color-surface-hover);
            color: var(--color-text-primary);
            border: 1px solid var(--color-border);
        }

        .btn-secondary:hover:not(:disabled) {
            background: var(--color-border);
            transform: translateY(-2px);
        }

        .btn-voice {
            background: var(--color-surface-hover);
            color: var(--color-text-primary);
            border: 2px solid var(--color-border);
        }

        .btn-voice:hover:not(:disabled) {
            border-color: var(--color-accent);
            background: rgba(59, 130, 246, 0.1);
        }

        .btn-voice.listening {
            background: rgba(239, 68, 68, 0.2);
            border-color: #ef4444;
            animation: pulse 1.5s infinite;
        }

        @keyframes pulse {
            0%, 100% {
                opacity: 1;
            }
            50% {
                opacity: 0.7;
            }
        }

        button:disabled {
            opacity: 0.5;
            cursor: not-allowed;
        }

        .icon {
            width: 20px;
            height: 20px;
        }

        .results-section {
            animation: fadeInUp 0.5s ease-out;
        }

        @keyframes fadeInUp {
            from {
                opacity: 0;
                transform: translateY(20px);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }

        .primary-result {
            background: var(--color-surface);
            border-radius: 16px;
            padding: 32px;
            margin-bottom: 32px;
            box-shadow: var(--shadow-lg);
            border: 2px solid transparent;
            transition: all 0.3s ease;
        }

        .primary-result.active {
            border-color: var(--color-active);
            background: linear-gradient(135deg, var(--color-active-bg) 0%, var(--color-surface) 100%);
        }

        .primary-result.terminated {
            border-color: var(--color-terminated);
            background: linear-gradient(135deg, var(--color-terminated-bg) 0%, var(--color-surface) 100%);
        }

        .primary-result.not-found {
            border-color: var(--color-not-found);
            background: linear-gradient(135deg, var(--color-not-found-bg) 0%, var(--color-surface) 100%);
        }

        .status-badge {
            display: inline-flex;
            align-items: center;
            gap: 8px;
            padding: 10px 20px;
            border-radius: 100px;
            font-size: 0.875rem;
            font-weight: 600;
            text-transform: uppercase;
            letter-spacing: 0.05em;
            margin-bottom: 20px;
        }

        .status-badge.active {
            background: var(--color-active);
            color: white;
        }

        .status-badge.terminated {
            background: var(--color-terminated);
            color: white;
        }

        .status-badge.not-found {
            background: var(--color-not-found);
            color: white;
        }

        .status-indicator {
            width: 8px;
            height: 8px;
            border-radius: 50%;
            background: white;
            animation: blink 2s infinite;
        }

        @keyframes blink {
            0%, 100% {
                opacity: 1;
            }
            50% {
                opacity: 0.3;
            }
        }

        .employee-name {
            font-size: clamp(1.75rem, 4vw, 2.5rem);
            font-weight: 700;
            margin-bottom: 12px;
            color: var(--color-text-primary);
        }

        .employee-location {
            font-size: 1.25rem;
            color: var(--color-text-secondary);
            margin-bottom: 8px;
            display: flex;
            align-items: center;
            gap: 8px;
        }

        .additional-results {
            margin-top: 32px;
        }

        .section-title {
            font-size: 1.125rem;
            font-weight: 600;
            color: var(--color-text-secondary);
            margin-bottom: 16px;
            text-transform: uppercase;
            letter-spacing: 0.05em;
        }

        .results-grid {
            display: grid;
            grid-template-columns: repeat(auto-fill, minmax(280px, 1fr));
            gap: 16px;
        }

        .result-card {
            background: var(--color-surface);
            border: 1px solid var(--color-border);
            border-radius: 12px;
            padding: 20px;
            transition: all 0.3s ease;
            cursor: pointer;
        }

        .result-card:hover {
            transform: translateY(-4px);
            box-shadow: var(--shadow-md);
            border-color: var(--color-accent);
        }

        .result-card .employee-name {
            font-size: 1.25rem;
            margin-bottom: 8px;
        }

        .result-card .employee-location {
            font-size: 0.875rem;
            margin-bottom: 12px;
        }

        .result-card .status-badge {
            font-size: 0.75rem;
            padding: 6px 14px;
            margin-bottom: 0;
        }

        .empty-state {
            text-align: center;
            padding: 64px 20px;
            color: var(--color-text-muted);
        }

        .empty-state svg {
            width: 80px;
            height: 80px;
            margin-bottom: 20px;
            opacity: 0.3;
        }

        .empty-state h3 {
            font-size: 1.5rem;
            margin-bottom: 12px;
            color: var(--color-text-secondary);
        }

        .loading {
            text-align: center;
            padding: 40px;
            color: var(--color-text-secondary);
        }

        .spinner {
            width: 40px;
            height: 40px;
            border: 3px solid var(--color-border);
            border-top-color: var(--color-accent);
            border-radius: 50%;
            animation: spin 1s linear infinite;
            margin: 0 auto 20px;
        }

        @keyframes spin {
            to {
                transform: rotate(360deg);
            }
        }

        .logo {
            width: 120px;
            height: auto;
            margin: 0 auto 20px;
            display: block;
            animation: logoFloat 0.8s ease-out;
            filter: drop-shadow(0 4px 12px rgba(0, 0, 0, 0.3));
        }

        @keyframes logoFloat {
            from {
                opacity: 0;
                transform: translateY(-20px);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }

                @media (max-width: 768px) {
            .container {
                padding: 10px;
            }

            .search-container {
                padding: 24px;
            }

            .primary-result {
                padding: 24px;
            }

            .button-group {
                flex-direction: column;
            }

            button {
                width: 100%;
            }

            .results-grid {
                grid-template-columns: 1fr;
            }
        }

        .error-message {
            background: rgba(239, 68, 68, 0.1);
            border: 1px solid var(--color-not-found);
            border-radius: 12px;
            padding: 16px;
            margin-top: 16px;
            color: var(--color-not-found);
            display: none;
        }

        .error-message.show {
            display: block;
        }
    </style>
</head>

da", "location": "North Wahsatch", "status": "Terminated"}, {"firstName": "Rose", "lastName": "Beasley", "location": "Fillmore", "status": "Terminated"}, {"firstName": "Lydia", "lastName": "Crimmins", "location": "Constitution", "status": "Terminated"}, {"firstName": "DONALD", "lastName": "PERRY", "location": "Fillmore", "status": "Terminated"}, {"firstName": "DIAMOND", "lastName": "PETTIFORD", "location": "North Wahsatch", "status": "Terminated"}, {"firstName": "Karen", "lastName": "Jalowiec", "location": "Third Party Administrators", "status": "Terminated"}];

        let recognition = null;
        let isListening = false;

        // Initialize speech recognition
        function initSpeechRecognition() {
            // Check if speech recognition is available
            const SpeechRecognition = window.SpeechRecognition || window.webkitSpeechRecognition;
            
            if (!SpeechRecognition) {
                document.getElementById('voiceBtn').disabled = true;
                document.getElementById('voiceBtnText').textContent = 'Voice Not Supported';
                console.log('Speech recognition not supported');
                return false;
            }

            try {
                recognition = new SpeechRecognition();
                recognition.continuous = false;
                recognition.interimResults = false;
                recognition.lang = 'en-US';
                recognition.maxAlternatives = 1;

                recognition.onstart = () => {
                    console.log('Speech recognition started');
                    isListening = true;
                    document.getElementById('voiceBtn').classList.add('listening');
                    document.getElementById('voiceBtnText').textContent = 'Listening...';
                    hideError();
                };

                recognition.onresult = (event) => {
                    console.log('Speech recognition result received');
                    const transcript = event.results[0][0].transcript;
                    console.log('Transcript:', transcript);
                    document.getElementById('searchInput').value = transcript;
                    performSearch(transcript);
                };

                recognition.onerror = (event) => {
                    console.error('Speech recognition error:', event.error);
                    let errorMessage = 'Voice recognition error. ';
                    
                    switch(event.error) {
                        case 'not-allowed':
                        case 'service-not-allowed':
                            errorMessage = 'Microphone access denied. Please allow microphone permissions in your browser settings.';
                            break;
                        case 'no-speech':
                            errorMessage = 'No speech detected. Please try again.';
                            break;
                        case 'audio-capture':
                            errorMessage = 'No microphone found. Please check your device.';
                            break;
                        case 'network':
                            errorMessage = 'Network error. Please check your connection.';
                            break;
                        default:
                            errorMessage += 'Please try again or use text input.';
                    }
                    
                    showError(errorMessage);
                    stopListening();
                };

                recognition.onend = () => {
                    console.log('Speech recognition ended');
                    stopListening();
                };

                return true;
            } catch (error) {
                console.error('Error initializing speech recognition:', error);
                document.getElementById('voiceBtn').disabled = true;
                document.getElementById('voiceBtnText').textContent = 'Voice Not Available';
                return false;
            }
        }

        function stopListening() {
            isListening = false;
            document.getElementById('voiceBtn').classList.remove('listening');
            document.getElementById('voiceBtnText').textContent = 'Voice Search';
        }

        function showError(message) {
            const errorEl = document.getElementById('errorMessage');
            errorEl.textContent = message;
            errorEl.classList.add('show');
            setTimeout(() => {
                errorEl.classList.remove('show');
            }, 5000);
        }

        function hideError() {
            const errorEl = document.getElementById('errorMessage');
            errorEl.classList.remove('show');
        }

        // Normalize string for comparison
        function normalizeString(str) {
            return str.toLowerCase().trim();
        }

        // Calculate similarity score (simple string matching)
        function calculateScore(employee, query) {
            const queryNorm = normalizeString(query);
            const firstNameNorm = normalizeString(employee.firstName);
            const lastNameNorm = normalizeString(employee.lastName);
            const fullNameNorm = `${firstNameNorm} ${lastNameNorm}`;
            const reverseNameNorm = `${lastNameNorm} ${firstNameNorm}`;

            let score = 0;

            // Exact matches
            if (fullNameNorm === queryNorm || reverseNameNorm === queryNorm) {
                score += 100;
            }
            
            // Starts with query
            if (firstNameNorm.startsWith(queryNorm) || lastNameNorm.startsWith(queryNorm)) {
                score += 50;
            }
            
            // Contains query
            if (fullNameNorm.includes(queryNorm) || reverseNameNorm.includes(queryNorm)) {
                score += 30;
            }

            // Partial word matches
            const queryWords = queryNorm.split(/\s+/);
            queryWords.forEach(word => {
                if (firstNameNorm.includes(word)) score += 20;
                if (lastNameNorm.includes(word)) score += 20;
            });

            return score;
        }

        // Search employees
        function searchEmployees(query) {
            if (!query || query.trim().length === 0) {
                return [];
            }

            const results = EMPLOYEES
                .map(emp => ({
                    ...emp,
                    score: calculateScore(emp, query)
                }))
                .filter(emp => emp.score > 0)
                .sort((a, b) => b.score - a.score)
                .slice(0, 10);

            return results;
        }

        // Render results
        function renderResults(results, query) {
            const resultsContainer = document.getElementById('results');
            
            if (results.length === 0) {
                resultsContainer.innerHTML = `
                    <div class="primary-result not-found">
                        <div class="status-badge not-found">
                            <span class="status-indicator"></span>
                            Not Found
                        </div>
                        <h2 class="employee-name">No Match Found</h2>
                        <p class="employee-location">
                            <svg class="icon" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                                <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M12 8v4m0 4h.01M21 12a9 9 0 11-18 0 9 9 0 0118 0z"/>
                            </svg>
                            No employee found matching "${query}"
                        </p>
                    </div>
                `;
                return;
            }

            // Primary result (best match)
            const primary = results[0];
            const statusClass = primary.status.toLowerCase();
            
            let html = `
                <div class="primary-result ${statusClass}">
                    <div class="status-badge ${statusClass}">
                        <span class="status-indicator"></span>
                        ${primary.status}
                    </div>
                    <h2 class="employee-name">${primary.firstName} ${primary.lastName}</h2>
                    <p class="employee-location">
                        <svg class="icon" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                            <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M17.657 16.657L13.414 20.9a1.998 1.998 0 01-2.827 0l-4.244-4.243a8 8 0 1111.314 0z"/>
                            <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M15 11a3 3 0 11-6 0 3 3 0 016 0z"/>
                        </svg>
                        ${primary.location}
                    </p>
                </div>
            `;

            // Additional results
            if (results.length > 1) {
                html += `
                    <div class="additional-results">
                        <h3 class="section-title">Other Possible Matches</h3>
                        <div class="results-grid">
                `;

                results.slice(1).forEach(emp => {
                    const empStatusClass = emp.status.toLowerCase();
                    html += `
                        <div class="result-card">
                            <h4 class="employee-name">${emp.firstName} ${emp.lastName}</h4>
                            <p class="employee-location">
                                <svg class="icon" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                                    <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M17.657 16.657L13.414 20.9a1.998 1.998 0 01-2.827 0l-4.244-4.243a8 8 0 1111.314 0z"/>
                                    <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M15 11a3 3 0 11-6 0 3 3 0 016 0z"/>
                                </svg>
                                ${emp.location}
                            </p>
                            <div class="status-badge ${empStatusClass}">
                                <span class="status-indicator"></span>
                                ${emp.status}
                            </div>
                        </div>
                    `;
                });

                html += `
                        </div>
                    </div>
                `;
            }

            resultsContainer.innerHTML = html;
        }

        // Perform search
        function performSearch(query) {
            if (!query || query.trim().length === 0) {
                document.getElementById('results').innerHTML = `
                    <div class="empty-state">
                        <svg fill="none" stroke="currentColor" viewBox="0 0 24 24">
                            <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z"/>
                        </svg>
                        <h3>Start Searching</h3>
                        <p>Enter an employee name or use voice search to begin</p>
                    </div>
                `;
                return;
            }

            // Show loading
            document.getElementById('results').innerHTML = `
                <div class="loading">
                    <div class="spinner"></div>
                    <p>Searching employees...</p>
                </div>
            `;

            // Simulate slight delay for better UX
            setTimeout(() => {
                const results = searchEmployees(query);
                renderResults(results, query);
            }, 300);
        }

        // Event listeners
        document.getElementById('searchBtn').addEventListener('click', () => {
            const query = document.getElementById('searchInput').value;
            performSearch(query);
        });

        document.getElementById('searchInput').addEventListener('keypress', (e) => {
            if (e.key === 'Enter') {
                performSearch(e.target.value);
            }
        });

        document.getElementById('voiceBtn').addEventListener('click', () => {
            console.log('Voice button clicked');
            
            if (!recognition) {
                showError('Voice recognition is not supported on this browser. Try Chrome, Edge, or Safari.');
                return;
            }

            if (isListening) {
                console.log('Stopping recognition');
                try {
                    recognition.stop();
                } catch (error) {
                    console.error('Error stopping recognition:', error);
                    stopListening();
                }
                return;
            }

            // Start recognition
            console.log('Starting recognition');
            try {
                // Clear any previous input
                hideError();
                
                // Request microphone permission and start
                recognition.start();
                
            } catch (error) {
                console.error('Recognition start error:', error);
                
                if (error.message && error.message.includes('already started')) {
                    // Already running, try to stop and restart
                    try {
                        recognition.stop();
                        setTimeout(() => {
                            try {
                                recognition.start();
                            } catch (e) {
                                console.error('Retry failed:', e);
                                showError('Could not start voice recognition. Please try again.');
                                stopListening();
                            }
                        }, 100);
                    } catch (stopError) {
                        console.error('Stop error:', stopError);
                        showError('Voice recognition error. Please refresh the page and try again.');
                        stopListening();
                    }
                } else {
                    showError('Could not start voice recognition. Please ensure microphone permissions are enabled.');
                    stopListening();
                }
            }
        });

        document.getElementById('clearBtn').addEventListener('click', () => {
            document.getElementById('searchInput').value = '';
            document.getElementById('results').innerHTML = `
                <div class="empty-state">
                    <svg fill="none" stroke="currentColor" viewBox="0 0 24 24">
                        <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z"/>
                    </svg>
                    <h3>Start Searching</h3>
                    <p>Enter an employee name or use voice search to begin</p>
                </div>
            `;
        });

        // Initialize
        const speechInitialized = initSpeechRecognition();
        console.log('Speech recognition initialized:', speechInitialized);
        
        if (speechInitialized) {
            console.log('Speech recognition is ready. Browser:', navigator.userAgent);
        } else {
            console.log('Speech recognition not available');
        }
        
        document.getElementById('results').innerHTML = `
            <div class="empty-state">
                <svg fill="none" stroke="currentColor" viewBox="0 0 24 24">
                    <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z"/>
                </svg>
                <h3>Start Searching</h3>
                <p>Enter an employee name or use voice search to begin</p>
            </div>
        `;
    </script>
